    position: absolute;
    top: 30%;
    right: 30%;
    z-index: -1;
    height: 60%;
    opacity: 0.4;
    @media (max-width: 900px) {
      display: none;
    }
  }

  .small-circle {
    position: absolute;
    bottom: 0%;
    left: 20%;
    z-index: -1;
    @media (max-width: 900px) {
      display: none;
    }
  }

  .row {
    width: 90%;
    position: relative;
    z-index: 2;
    max-width: 1186px;
    margin: 0 auto;
    height: 100%;
    display: grid;
    grid-template-columns: 590px 610px;
    grid-template-rows: 100vh;
    gap: 4ch;
    transition: 0.1s;

    @media (max-width: 900px) {
      display: flex;
      height: 100%;
      flex-direction: column;
    }

