      height: 100%;

      display: flex;
      flex-direction: column;
      justify-content: flex-start;
      align-items: flex-start;
      @media (max-width: 900px) {
        min-height: 100%;
      }
      .intro-text {
        padding: 10vh 0;
        margin-top: 3em;
        @media (max-width: 900px) {
          text-align: center;
          padding: 0;
        }
        h1 {
          font-size: 47px;
          font-weight: 600;

          flex: 1;
          @media (max-width: 900px) {
            font-size: 24px;
          }
        }

        p {
          flex: 1;
          font-size: 18px;
          @media (max-width: 900px) {
            margin-top: 36px;
            font-size: 16px;
            font-weight: 300;
          }
        }

        button {
          border: none;
        }
      }

      .cta {
        @media (max-width: 900px) {
          width: 100%;
          display: flex;
          flex-direction: column;
          align-items: center;
          justify-content: center;
          padding: 0vh 0;
        }

        button {
          border-radius: 3px;
          width: 90%;
          width: 150px;
          height: 50px;

          margin: 2.5vh 1em;

          &:nth-child(1) {
            color: $Second;
            background: transparent;
            border: 2px solid $Second;
            transition: 0.2s;

            &:hover {
              color: $First;
              border: 2px solid $First;
            }
          }

          &:nth-child(2) {
            border: none;
            background-color: $Second;
            color: white;
            transition: 0.2s;

            &:hover {
              border: none;
              background-color: $First;
              color: white;
            }
          }
